import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';
import logoLube from '../logoLube.png';

const Logo = () => {
  return <div className="NavbarLogo" >
    <img src={logoLube} style={{ height: '100%', width: '10%' }} />
    <h1 style={{ letterSpacing: 10 }}>DASHBOARD</h1>
  </div>
}

function Navbar() {
  return (
    <div className="Navbar">

      <Logo />

      <ul className="Links">
        <Link style={{ color: '#fff', textDecoration: 'none' }} to="/" >
          <li>Home</li>
        </Link>
        <Link style={{ color: '#fff', textDecoration: 'none' }} to="/about" >
          <li>About</li>
        </Link>
        <Link style={{ color: '#fff', textDecoration: 'none' }} to="/contact" >
          <li>Contact</li>
        </Link>
      </ul>
    </div>
  );
}

export default Navbar;
